import "./ReturnComponent.css"

function ReturnComponent(){

    const guitars = []

    return(
        <div className="main-div">

            {guitars.map(guitar => {
                <>
                    <div>
                        <img>guitar.pictureMain</img>
                        <button></button>
                    </div>

                    <p>guitar.productDetail</p>
                </>

            })}

        </div>
    );
}

export default ReturnComponent;
